using System;
using System.IO;
using System.Security.Cryptography.X509Certificates;
using Xunit;
using CourseApp.Module3;

namespace CourseApp.Tests.Module3
{
    [Collection("Sequential")]
    public class FindStringTest : IDisposable
    {
        public void Dispose()
        {
            var standardOut = new StreamWriter(Console.OpenStandardOutput());
            standardOut.AutoFlush = true;
            var standardIn = new StreamReader(Console.OpenStandardInput());
            Console.SetOut(standardOut);
            Console.SetIn(standardIn);
        }

        [Theory]
        [InlineData("ababbababa\naba", "0 5 7")]
        [InlineData("\\nbbcccab", "287\r\n1585\r\n3612\r\n4294\r\n10800\r\n12025\r\n20604\r\n26894\r\n")]
            public void Test1(string input, string expected)
        {
            var stringWriter = new StringWriter();
            Console.SetOut(stringWriter);

            var stringReader = new StringReader(input);
            Console.SetIn(stringReader);

            // act
            FindString.FindStr();

            // assert
            var output = stringWriter.ToString().Split(Environment.NewLine, StringSplitOptions.RemoveEmptyEntries);
            Assert.Equal($"{expected}", output[0]);
            var standardOutput = new StreamWriter(Console.OpenStandardOutput());
        }
    }
}
